import React from "react";
import logo from "../img/logo.svg";

class Header extends React.Component {
  render() {
    return (
      <header>
        <ul>
          <li className="lb">
            <b>L&B</b>
          </li>

          <li>Home</li>
          <li>collection</li>
          <li>contact</li>
        </ul>
      </header>
    );
  }
}

export default Header;
